import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      string: 'Hello Edoardo'
    }
  }
  render() {
      return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <p>{this.state.string}</p>
            <button onClick={ this.state.string = 'Hello Edoardo' ? this.setState({string: 'Hello Edo'}) : this.setState({string: 'Hello Edoardo'})}>Change Text</button>
          </header>
        </div>
      );
  }
}

export default App;
